import { Box, Container } from "@mui/material"
import styles from 'utilities/global_styles.module.css'

const TopBar = () => {
    return(
    <Container maxWidth="lg" style={{ height: "72px" }} sx={{ margin: {top: 16, bottom: 16}, alignItems: "center", display: "flex" }}>
        <img src="img/app_logo.svg"/>

        <Box className={styles.headerTitle}>Civitas Europe</Box>
       </Container>
    );
}

export default TopBar
